nsectetur. In molestie, ante in mattis vestibulum, augue massa lacinia lectus, tincidunt egestas enim lectus id dolor. Integer velit risus, maximus ut tincidunt ut, aliquam scelerisque lacus. Praesent ullamcorper dolor vel augue euismod, ut aliquam lectus pellentesque.</span></p><p style="text-align: justify; font-size: 11px; line-height: 14px; margin-bottom: 14px; padding: 0px; font-family: Arial, Helvetica, sans;"><span style="font-size: 14px;">Phasellus euismod gravida tincidunt. Proin ultricies malesuada sapien vel dictum. Nulla interdum est felis, non accumsan ex venenatis vitae. Donec lacus eros, egestas sodales arcu a, consequat consectetur elit. Cras tempus arcu nec dui tincidunt, eget lacinia libero malesuada. Praesent semper sit amet diam nec laoreet. Ut suscipit, ipsum ac egestas efficitur, ante libero luctus mi, ac mollis elit magna non eros. Mauris dignissim lacus libero. Quisque semper massa sit amet lectus tristique lobortis. Maecenas efficitur suscipit ipsum non faucibus. Phasellus sed lacus erat. Cras iaculis nisl eget elit gravida, vel tincidunt eros aliquet. Integer id consequat sem. Nam vel turpis vitae libero cursus sollicitudin. Interdum et malesuada fames ac ante ipsum primis in faucibus.</span></p>', '08/17/2015', '02:13 PM', 0, 0);
