INSERT INTO `tbl_static_pages` (`pageid`, `title`, `content`, `upload_by`, `arc`) VALUES
(9, 'Spongebob', '<p><img class="pull-right" src="https://upload.wikimedia.org/wikipedia/en/thumb/2/24/SpongeBob_SquarePants_logo.svg/250px-SpongeBob_SquarePants_logo.svg.png" style="width: 250px; float: right;"></p><p><i><b>SpongeBob SquarePants</b></i> is an American <a href="https://en.wikipedia.org/wiki/Animated_series" title="Animated series">animated television series</a> created by <a href="https://en.wikipedia.org/wiki/Marine_biology" title="Marine biology">marine biologist</a> and <a href="https://en.wikipedia.org/wiki/Animator" title="Animator">animator</a> <a href="https://en.wikipedia.org/wiki/Stephen_Hillenburg" title="Stephen Hillenburg">Stephen Hillenburg</a> for <a href="https://en.wikipedia.org/wiki/Nickelodeon" title="Nickelodeon">Nickelodeon</a>. The series chronicles the adventures and endeavors of <a href="https://en.wikipedia.org/wiki/SpongeBob_SquarePants_%28character%29" title="SpongeBob SquarePants (character)">the title character</a> and his various friends in the fictional underwater city of Bikini Bottom. The series'' popularity has made it a <a href="https://en.wikipedia.org/wiki/Media_franchise" title="Media franchise">media franchise</a>, as well as the highest rated series to ever air on Nickelodeon, and the most distributed property of <a href="https://en.wikipedia.org/wiki/Viacom_Media_Networks" title="Viacom Media Networks">MTV Networks</a>. The media franchise has generated $8 billion in merchandising revenue for Nickelodeon.</p><p>\r\n</p><p>Many of the ideas for the series originated in an unpublished, educational comic book titled <i>The Intertidal Zone</i>, which Hillenburg created in the mid-1980s. He began developing <i>SpongeBob SquarePants</i> into a television series in 1996 upon the cancellation of <i><a href="https://en.wikipedia.org/wiki/Rocko%27s_Modern_Life" title="Rocko''s Modern Life">Rocko''s Modern Life</a></i>, and turned to <a href="https://en.wikipedia.org/wiki/Tom_Kenny" title="Tom Kenny">Tom Kenny</a>, who had worked with him on that series, to voice the titular character. SpongeBob was originally going to be named <i>SpongeBoy</i>, and the series was to be called <i>SpongeBoy Ahoy!</i>, but these were both changed, as the name was already trademarked.</p><p>\r\n</p><p>Nickelodeon held a preview for the series in the United States on May 1, 1999, following the television airing of the <a href="https://en.wikipedia.org/wiki/1999_Kids%27_Choice_Awards" title="1999 Kids'' Choice Awards">1999 Kids'' Choice Awards</a>.\r\n The series officially premiered on July 17, 1999. It has received \r\nworldwide critical acclaim since its premiere and gained enormous \r\npopularity by its second season. A feature film, <i><a href="https://en.wikipedia.org/wiki/The_SpongeBob_SquarePants_Movie" title="The SpongeBob SquarePants Movie">The SpongeBob SquarePants Movie</a></i>, was released in theaters on November 19, 2004, and <a href="https://en.wikipedia.org/wiki/The_SpongeBob_Movie:_Sponge_Out_of_Water" title="The SpongeBob Movie: Sponge Out of Water">a sequel</a> was released on February 6, 2015. On July 21, 2012, the series was renewed and aired its <a href="https://en.wikipedia.org/wiki/SpongeBob_SquarePants_%28season_9%29" title="SpongeBob SquarePants (season 9)">ninth season</a>, beginning with the episode "<a href="https://en.wikipedia.org/wiki/Extreme_Spots" title="Extreme Spots">Extreme Spots</a>".</p><p>\r\n</p><p>The series has won a variety of awards, including six <a href="https://en.wikipedia.org/wiki/Annie_Award" title="Annie Award">Annie Awards</a>, eight <a href="https://en.wikipedia.org/wiki/Motion_Picture_Sound_Editors#Golden_Reel_Awards" title="Motion Picture Sound Editors">Golden Reel Awards</a>, two <a href="https://en.wikipedia.org/wiki/Emmy_Award" title="Emmy Award">Emmy Awards</a>, 12 <a href="https://en.wikipedia.org/wiki/Nickelodeon_Kids%27_Choice_Awards" title="Nickelodeon Kids'' Choice Awards">Kids'' Choice Awards</a>, and two <a href="https://en.wikipedia.org/wiki/British_Academy_Children%27s_Awards" title="British Academy Children''s Awards">BAFTA Children''s Awards</a>.\r\n Despite its widespread popularity, the series has been involved in \r\nseveral public controversies, including one centered on speculation over\r\n SpongeBob''s intended sexual orientation. In 2011, a newly described \r\nspecies of mushroom, <i><a href="https://en.wikipedia.org/wiki/Spongiforma_squarepantsii" title="Spongiforma squarepantsii">Spongiforma squarepantsii</a></i>, was named after the cartoon''s title character. '''''''''''''''''' asdas''''''''<br></p><p><br></p>', 1, 1),
